import React, { useEffect, useState } from 'react'


interface IHero{
  
    "id": number,    
    "edited": string,    
    "name": string,    
    "created": string,    
    "gender": string,    
    "skin_color": string,    
    "hair_color": string,    
    "height": string,    
    "eye_color": string,    
    "mass": string,    
    "homeworld": number,    
    "birth_year": string,    
    "image": string}

const AboutMe = () => {
const [hero, setHero] = useState<undefined>();

useEffect(() => {
  fetch("https://sw-info-api.herokuapp.com/v1/peoples/1")
  .then(response => response.json())
  .then(data=> setHero(data))
}, []);

  return (
    hero && (
    <div>
      <img src='' alt={hero.name} />
    </div>
    )
  )
}

export default AboutMe
